import Records from "./components/Records"
import SearchStudent from "./components/SearchStudents";
import React, {useEffect, useState} from 'react'
import axios from 'axios'
import "./App.css"

function App() {
  const[students, setStudents] = useState(null);

  useEffect(()=>{
    axios.get('https://localhost:3300/reptiles')
    .then((response)=>{
      setStudents(response.data)
    }).catch(err =>{
      console.log(err);
      alert('An error occurred within the rsponse.')
    })
  },[])
  return (
    <div className="App">
      <SearchStudent placeholder={"Enter first or last name of student."} />
      <br />
      <Records />
    </div>
  );
}

export default App;
